import { Link } from "react-router-dom";

export default function Resume() {
  return (
    <main style={{ padding: "2rem 2rem" }}>
      <p>Welcome to the resume.</p>
      <Link to="/">Back Home</Link>

      <p style={{ paddingTop: "50px" }}>Include copy of my resume here (update with Brett's final formatting using the full copy of Microsoft word. Remove my email/phone/address from resume and replace with a direct link to my contact form).</p>
    </main>
  );
}
